        return(
            updateDetails(details)
        )
    }
  return (
    <div>
        <UserForm onSubmittedDetails={InSubmittedDetails}/>
        <div>Name:{oldDetails.Name}</div>
    </div>
    
    
    
    

  )
}

export default SubmittedDetails
